function Note(props){

    const currentDate=new Date().toUTCString() ;
    return (
        <div className="note">
      
            <h1>{props.title}</h1>
            <div></div><p>{props.content}</p>
            <p align="right"> <b>{currentDate} </b> </p>


        </div>
    );
}

export default Note
